import React from "react";

function Nav() {
  return (
    <div className="nav">
      <img
        className="nav_logo"
        src="https://assets.brand.microsites.netflix.io/assets/493f5bba-81a4-11e9-bf79-066b49664af6_cm_1440w.png?v=49"
        alt="netflix logo"
      />
      <img
        className="nav_avatar"
        src="https://assets.brand.microsites.netflix.io/assets/493f5bba-81a4-11e9-bf79-066b49664af6_cm_1440w.png?v=49"
        alt="netflix logo"
      />
    </div>
  );
}

export default Nav;
